import React, { Component } from 'react';
import './App.css';
import Nav from "../client/components/Nav";
import Resume from "../client/components/Resume";
import Bio from "../client/components/Bio";

class App extends Component {

  render() {
    let courses = [ "Intro to Software Engineering", "Information and Database Systems", 
    "Data Structures and Algorithms", "Intro to Computer Organization",
    "Elementary Differential Equations", "Applications of Discrete Structures", "Programming Fundamentals 1-2"];

    return (
      <div className="App">
        <Nav/>
        <Resume year="2nd" relevant_courses= {courses} />
        <Bio/>

      </div>
    );
  }
}

export default App;
